PetiteVue.createApp({
    static: {
        brands: [
            {
                name: "Redwood",
                logo: "data:image/png;base64,"
            },
            {
                name: "ActiveBatch",
                logo: "data:image/png;base64,",
            },
            {
                name: "JSCAPE",
                logo: "data:image/png;base64,",
            },
            {
                name: "Cerberus FTP",
                logo: "data:image/png;base64,",
            },
            {
                name: "Tidal",
                logo: "data:image/png;base64,",
            },
        ]
    },
    notifications: [],
    fields: {
        name: "Your Full Name",
        title: "Your Job Title",
        phone: "+1 111 1111 1111",
        email: "info@redwood.com",
        linkedIn: "https://www.linkedin.com/company/redwood-software",
        brand: "Redwood"
    },
    get currentBrand() {
        return this.static.brands.find( brand => ( brand.name === this.fields.brand ) )
    },
    notify(message, duration = 4000) {
        if (this.notifications.length)
            clearTimeout(this.notifications.at(-1).id);
        this.notifications.push({
            message, 
            duration, 
            id: setTimeout(() => {
                this.notifications = []
            }, duration)
        })
    },
    copySignature() {
        navigator.permissions.query({ name: "clipboard-write" }).then((result) => {
            if (result.state === "granted" || result.state === "prompt") {

                let content = document.querySelector("#rendered-signature").innerHTML;
                    content = new Blob( [content], { type: "text/html" } );
                    content = new ClipboardItem({ "text/html" : content });

                navigator.clipboard.write([content]).then(
                    () => {
                        this.notify("Your signature has been copied")
                    },
                    () => {
                        this.notify("Your signature couln't be copied. If the issue persistes, please contact your administrator")
                    },
                );

            }
        });
        
    }
}).mount()